import React from 'react';
import PropTypes from 'prop-types';
import { Col, List, Row } from 'antd';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	console.log(current);

	return (
		<Row>
			<List
				size='small'
				bordered
				dataSource={current}
				renderItem={(item) => <List.Item>{}</List.Item>}
			/>
		</Row>
	);
}

export default ListViewTest;
